import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import { ProjectsPage } from './ProjectsPage/ProjectsPageComponent';
import { GoalsPage } from './GoalsPage/GoalsPageComponent';
import {HashRouter, Routes, Route} from 'react-router-dom';
import { readProjects } from './ProjectsPage/ProjectClass';
import { readColors } from './ColorPickerComponent/SavedColorComponent/SavedColorClass';

import 'ModalStyles.css';

const root = ReactDOM.createRoot(document.getElementById('root'));

readProjects();
readColors();

root.render(
  <HashRouter>
    <Routes>
      <Route path="/" element={<ProjectsPage />} />
      <Route path="/project/:id" element={<GoalsPage />} />
    </Routes>
  </HashRouter>
);
